import React, { Component } from 'react';
import ReactDom from 'react-dom';
import { Carousel, Item, Caption, Card, Col, Figure, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import ReactDOM from 'react-dom';
import './vehicle.css'


export default function Vehicle_detail(props) {
    //alert(props.vehicle_name);
    return (
        <div className="col-12 col-md-12 col-lg-12">

            <Card className="text-center">
                <Card.Header>Featured</Card.Header>
                <Card.Body>
                    <Card.Title>Special title treatment</Card.Title>
                    <Card.Text>
                    <img className="imgsize" src={process.env.PUBLIC_URL+"tata_sumo.jpg"} alt="First slide"  />


                    </Card.Text>
                    <Button variant="primary">Go somewhere</Button>
                </Card.Body>
                <Card.Footer className="text-muted">2 days ago</Card.Footer>
            </Card>


        </div>



    )


}
